import React from "react";
import {RouteComponentProps} from "react-router";
import {App, Server} from "../types/types";
import serve from "@webpack-cli/serve";

interface Props {
    email: string | null;
    servers: Server[];
    editServer: (server: Server, email: string | null) => void;
    removeServer: (id: number, email: string | null) => void;
    sshConnectionUpdate: (ip: string, user: string, password: string, type: string) => void;
}

interface State {
    user: null | string,
    password: null | string,
    sshIp: null | string,
    name: string;
    ip: string;
    id: number;
}

interface Action {
    type: string;
    payload: any;
}

const {useReducer} = React;

function reducer(state: State, action: Action) {
    switch (action.type) {
        case 'user': {
            return {
                ...state, user: action.payload
            }
        }
        case 'password': {
            return {
                ...state, password: action.payload
            }
        }
        case 'sshIp': {
            return {
                ...state, sshIp: action.payload
            }
        }
        case 'name': {
            return {
                ...state, name: action.payload
            }
        }
        case 'id': {
            return {
                ...state, id: action.payload
            }
        }
        case 'ip': {
            return {
                ...state, ip: action.payload
            }
        }
        default: {
            return {
                ...state, user: null, password: null, sshIp: null, ip: 'default', id: 0, name: 'default'
            }
        }
    }
}

